// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

contract CPABEDecryption {

    struct DecryptionRecord {
        address user;
        bytes32 dataHash;  // Hash of encrypted data
        bytes32 attributesUsedHash;  // Hash of attributes used for decryption
        uint256 timestamp;  // Time of decryption
        bool success;  // Whether decryption was successful
    }

    mapping(bytes32 => DecryptionRecord) public records;

    event DataDecrypted(
        address indexed user,
        bytes32 indexed dataHash,
        bytes32 indexed attributesUsedHash,
        uint256 timestamp,
        bool success
    );

    function logDecryption(
        bytes32 dataHash, 
        bytes32 attributesUsedHash, 
        bool success
    ) public {
        records[dataHash] = DecryptionRecord({
            user: msg.sender,
            dataHash: dataHash,
            attributesUsedHash: attributesUsedHash,
            timestamp: block.timestamp,
            success: success
        });

        emit DataDecrypted(msg.sender, dataHash, attributesUsedHash, block.timestamp, success);
    }

    function getRecord(bytes32 dataHash) 
        public 
        view 
        returns (address, bytes32, bytes32, uint256, bool) 
    {
        DecryptionRecord memory record = records[dataHash];
        require(record.user != address(0), "Record not found");
        return (record.user, record.dataHash, record.attributesUsedHash, record.timestamp, record.success);
    }
}
